import { useContext } from 'react';
import { ProductsContext } from '../../components/context/context-product';

const Shop = () => {
    const products = useContext(ProductsContext)
    return (
        <div>
            {products.map(({id,name}) => (
                <div key={id}>
                    <h1> {name} </h1>
                </div>
             ) )}
        </div>
    )
}

export default Shop;
